import React from 'react';

function Auth() {
  return (
    <>
        <header>
            <ul>
                <li id="Logo"><img src="Sources/images/logo.png" alt=""/></li>
            </ul>
        </header>
        <div id="NotFound">
            <p>This Page Does Not Exists</p>
        </div>
    </>
  );
}

export default Auth;
